import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{o,c as a,e as s,a as r,f as n}from"./app-fdb4e109.js";const i={},c=r("p",null,'Esto acabó, pero mi sensación es "estamos empezando".',-1),t=n('<p>TECNIMAP 2010 nos permitió dar a conocer nuestro <strong>proyecto de Escritorio Software Libre para el Ayuntamiento de Zaragoza</strong>. Llevamos 5 años trabajando para que esto sea una realidad y poco a poco lo vamos consiguiendo. Lo vamos consiguiendo no sin esfuerzo y sinsabores, con el esfuerzo diario de nuestros técnicos. Para ellos vaya mi sincero agredecimiento.</p><p>TECNIMAP 2010 nos permitió constatar que muchas administraciones lo tienen claro, el camino del Escritorio se recorre en direccion al Software Libre. Desde Andalucía, Valencia, Canarias, Huesca, Guadalajara, Galicia, Málaga, Asturias, Cantabria, Madrid, País Vasco y muchos otros que ya no puedo recordar hemos encontrado mucho intereses por recorrer este camino que nosotros empezamos hace un tiempo. Nos gustaría dar un poco de nuestra luz a este camino penumbroso en muchos de sus tramos.</p><p>TECNIMAP 2010 nos permitió constatar que el camino del Escritorio Software Libre es viable y además, rentable social y económicamente. Pero no olvidemos que, como casi todo en la vida, para llegar al éxito es necesario disponer de recursos y organización.</p><p><a href="mailto:azlinux@zaragoza.es">Aquí estamos para lo que necesitéis</a>.</p><blockquote><p>Eduardo Romero Moreno</p></blockquote><blockquote><p>Servicio de Redes y Sistemas</p></blockquote><blockquote><p>Ayuntamiento de Zaragoza</p></blockquote>',7);function m(l,u){return o(),a("div",null,[c,s(" more "),t])}const _=e(i,[["render",m],["__file","2010-04-12-sensaciones-tecnimap-2010.html.vue"]]);export{_ as default};
